import React, { Component } from "react";

class Post extends Component {
  render() {
    const { posts } = this.props;
    return (
      <div>
        {posts.map(post => (
          <div key={post._id} className="my-3 ">
            <div className="card card-body">{post.text}</div>
          </div>
        ))}
      </div>
    );
  }
}
export default Post;
